	<script>
		$(document).ready(function() {
			$(".imgtd").click(function(){
				if ($(this).find(".codeimage").hasClass("expanded")) {
					$(this).find(".codeimage").removeClass("expanded");
				}
				else {
					$(this).find(".codeimage").addClass("expanded");
					
					if ($(this).find(".codeimage").attr("src").slice(9, 23) == "usergen/thumb/") {
						$(this).find(".codeimage").attr("src", "/res/img/usergen/" + $(this).find(".codeimage").attr("src").slice(23));
					}
				}
			})
		});
	</script>
